import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import ProductManagement from './components/ProductManagement';
//import UserManagement from './components/UserManagement';
import UserManagement2 from './components/userManagement2'; // Renaming to PascalCase for consistency
import SignUp from './components/SignUp';

const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [products, setProducts] = useState([
        { id: 1, name: 'Chicken Wings', category: 'Food', quantity: 50, price: 10 },
        { id: 2, name: 'Soda', category: 'Beverage', quantity: 100, price: 1.5 },
    ]);
    const [users, setUsers] = useState([]);

    const handleLogin = () => setIsAuthenticated(true);
    const handleLogout = () => setIsAuthenticated(false);

    return (
        <Router>
            <marquee style={{ background: '#333', color: '#fff', padding: '1rem' }}>Limkokwing Wings Cafe</marquee>
            <div>
                <nav style={{ background: '#333', padding: '1rem', display: 'flex', justifyContent: 'center' }}>
                    {isAuthenticated && (
                        <>
                            <Link to="/dashboard" style={{ color: '#fff', textDecoration: 'none', margin: '0 1rem' }}>Dashboard</Link>
                            <Link to="/products" style={{ color: '#fff', textDecoration: 'none', margin: '0 1rem' }}>Product Management</Link>
                            <Link to="/users2" style={{ color: '#fff', textDecoration: 'none', margin: '0 1rem' }}>User Management </Link>
                            <Link to="/login" style={{ color: '#fff', textDecoration: 'none', margin: '0 1rem' }} onClick={handleLogout}>Logout</Link>
                        </>
                    )}
                </nav>

                <Routes>
                    <Route 
                        path="/login" 
                        element={isAuthenticated ? <Navigate to="/dashboard" /> : (
                            <div style={{
                                textAlign: 'center',
                                margin: '2rem auto',
                                padding: '2rem',
                                maxWidth: '400px',
                                borderRadius: '8px',
                                background: '#2193b0',
                                color: '#fff'
                            }}>
                                <h2>Login</h2>
                                <form onSubmit={(e) => { e.preventDefault(); handleLogin(); }}>
                                    <input type="text" placeholder="Username" required style={{ margin: '0.5rem 0', padding: '0.5rem', width: '100%' }} />
                                    <input type="password" placeholder="Password" required style={{ margin: '0.5rem 0', padding: '0.5rem', width: '100%' }} />
                                    <button type="submit" style={{ padding: '0.5rem 1rem', background: '#ff4b1f', color: '#fff', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
                                        Login
                                    </button>
                                </form>
                                <Link to="/signup" style={{ color: '#fff', textDecoration: 'none', marginTop: '1rem', display: 'inline-block' }}>Sign In</Link>
                            </div>
                        )}
                    />
                    <Route path="/signup" element={<SignUp />} /> {/* New sign-up route */}
                    <Route path="/products" element={isAuthenticated ? <ProductManagement products={products} setProducts={setProducts} /> : <Navigate to="/login" />} />
                    <Route path="/dashboard" element={isAuthenticated ? <Dashboard products={products} /> : <Navigate to="/login" />} />
                    <Route path="/users2" element={isAuthenticated ? <UserManagement2 users={users} setUsers={setUsers} /> : <Navigate to="/login" />} />
                    <Route path="/" element={<Navigate to="/login" />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
